function Header() {
  return (
    <div className="header">
      <h1 className="header__welcome">שלום שאול</h1>
      <p className="header__description">הזמנתך התקבלה במערכת, בוא נגדיר יחד איך הסרט שלך אמור להראות</p>
    </div>
  );
}

export default Header;
